import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const a = "https://picsum.photos/200/300";
const b = "https://picsum.photos/270/300";
const c = "https://picsum.photos/290/300";

ReactDOM.render(
    <>
    <h1 className="heading"> Hello, My Name Is Eti </h1>

    <div className= "img_div">
    <img src={a} alt="randomImg" />
    <img src={b} alt="randomImg" />
    <img src={c} alt="randomImg" />
    </div>


    </>,


document.getElementById('root'));
